import { Card } from "./Card";

const Post = () => {
  return (
    <div>
      <Card>
        <Card.CardContent>
          {content.map((item, index) => {
            return <CardItem key={index} item={item} />;
          })}
        </Card.CardContent>

        <Card.Expand>
          <div>show more</div>
        </Card.Expand>

        <Card.Collapse>
          <div>show less</div>
        </Card.Collapse>
      </Card>
    </div>
  );
};
